import productionConfig from "./config.production.json";
import developmentConfig from "./config.development.json"
export default () => {

    switch (process.env.NODE_ENV) {
        case "development":
        case "test": {
            return productionConfig;
        }
        case "production": {
            return productionConfig;
        }

        default: {
            throw new Error("NODE_ENV not being set");
        }
    }
};
